namespace SpriteKind {
    export const star = SpriteKind.create()
    export const kicking = SpriteKind.create()
    export const k2 = SpriteKind.create()
    export const p2 = SpriteKind.create()
    export const kh22 = SpriteKind.create()
    export const p1 = SpriteKind.create()
    export const fireing2 = SpriteKind.create()
    export const fire = SpriteKind.create()
    export const dkh = SpriteKind.create()
    export const god = SpriteKind.create()
    export const khliglt = SpriteKind.create()
}
sprites.onOverlap(SpriteKind.kicking, SpriteKind.dkh, function (sprite, otherSprite) {
    sprites.destroy(kh2)
    sprites.destroy(projectile)
})
controller.player2.onButtonEvent(ControllerButton.B, ControllerButtonEvent.Pressed, function () {
    kamekame_ha_p2()
    if (kamekame_ha_p2() == 1) {
        mySprite3.setKind(SpriteKind.fireing2)
        kh2 = sprites.createProjectileFromSprite(assets.image`kame kame ha dark`, mySprite3, 25, 25)
        kh2.setKind(SpriteKind.dkh)
        kh2.follow(mySprite)
        mySprite3.setImage(assets.image`player2`)
        mySprite3.setKind(SpriteKind.p2)
        kmkmh2 = 0
    }
})
controller.B.onEvent(ControllerButtonEvent.Pressed, function () {
    kame_kame_ha_p1()
    if (kame_kame_ha_p1() == 1) {
        mySprite.setKind(SpriteKind.fire)
        projectile = sprites.createProjectileFromSprite(assets.image`kame kame ha`, mySprite, 25, 25)
        pause(100)
        projectile.setKind(SpriteKind.khliglt)
        projectile.follow(mySprite3)
        mySprite.setImage(assets.image`player0`)
        mySprite.setKind(SpriteKind.p1)
        kmkmh_1 = 0
    }
})
sprites.onOverlap(SpriteKind.k2, SpriteKind.p1, function (sprite, otherSprite) {
    statusbar.value += -5
    kmkmh2 += 1
})
function kame_kame_ha_p1 () {
    if (kmkmh_1 == 3) {
        return 1
    } else {
        return 0
    }
}
sprites.onOverlap(SpriteKind.dkh, SpriteKind.p1, function (sprite, otherSprite) {
    sprites.destroyAllSpritesOfKind(SpriteKind.dkh)
    statusbar.value += -20
    kmkmh2 += 1
})
controller.A.onEvent(ControllerButtonEvent.Pressed, function () {
    if (gsmestarted == 1) {
        mySprite.setKind(SpriteKind.kicking)
        animation.runImageAnimation(
        mySprite,
        assets.animation`kick right 1p`,
        2000,
        true
        )
        pause(100)
        mySprite.setKind(SpriteKind.p1)
        animation.runImageAnimation(
        mySprite,
        assets.animation`normal`,
        500,
        true
        )
    }
})
controller.player2.onButtonEvent(ControllerButton.A, ControllerButtonEvent.Pressed, function () {
    if (gsmestarted == 1) {
        mySprite3.setKind(SpriteKind.k2)
        animation.runImageAnimation(
        mySprite3,
        assets.animation`kick right 2p`,
        200,
        true
        )
        pause(100)
        mySprite3.setKind(SpriteKind.p2)
        animation.runImageAnimation(
        mySprite3,
        assets.animation`normal 2p`,
        500,
        true
        )
    }
})
function menu2 () {
    music_menu = ["kung fu panda music", "dojo music", "kung fu music"]
    blockMenu.showMenu(music_menu, MenuStyle.List, MenuLocation.FullScreen)
    blockMenu.setControlsEnabled(true)
}
sprites.onOverlap(SpriteKind.kicking, SpriteKind.p2, function (sprite, otherSprite) {
    statusbar2.value += -5
    kmkmh_1 += 1
})
sprites.onOverlap(SpriteKind.god, SpriteKind.dkh, function (sprite, otherSprite) {
    mp.gameOverPlayerWin(mp.playerSelector(mp.PlayerNumber.One))
})
statusbars.onZero(StatusBarKind.EnemyHealth, function (status) {
    mp.gameOverPlayerWin(mp.playerSelector(mp.PlayerNumber.One))
})
statusbars.onZero(StatusBarKind.Health, function (status) {
    mp.gameOverPlayerWin(mp.playerSelector(mp.PlayerNumber.Two))
})
sprites.onOverlap(SpriteKind.khliglt, SpriteKind.p2, function (sprite, otherSprite) {
    sprites.destroy(projectile)
    statusbar2.value += -30
})
function kamekame_ha_p2 () {
    if (kmkmh2 == 3) {
        return 1
    } else {
        return 0
    }
}
sprites.onOverlap(SpriteKind.god, SpriteKind.Projectile, function (sprite, otherSprite) {
    mp.gameOverPlayerWin(mp.playerSelector(mp.PlayerNumber.One))
})
function main_script () {
    gsmestarted = 1
    delay = 0
    kmkmh_1 = 0
    kmkmh2 = 0
    scene.setBackgroundImage(assets.image`dojo`)
    mySprite = sprites.create(assets.image`player0`, SpriteKind.p1)
    mySprite3 = sprites.create(assets.image`player2`, SpriteKind.p2)
    mySprite.setBounceOnWall(true)
    mySprite3.setBounceOnWall(true)
    mySprite.setPosition(4, 57)
    controller.moveSprite(mySprite)
    controller.player2.moveSprite(mySprite3)
    statusbar = statusbars.create(20, 4, StatusBarKind.Health)
    statusbar2 = statusbars.create(20, 4, StatusBarKind.EnemyHealth)
    statusbar2.max = 100
    statusbar.max = 100
    statusbar.attachToSprite(mySprite)
    statusbar2.attachToSprite(mySprite3)
}
sprites.onOverlap(SpriteKind.dkh, SpriteKind.fire, function (sprite, otherSprite) {
    sprites.destroyAllSpritesOfKind(SpriteKind.dkh)
    statusbar.value += -20
    kmkmh_1 += 1
})
sprites.onOverlap(SpriteKind.god, SpriteKind.fireing2, function (sprite, otherSprite) {
    mp.gameOverPlayerWin(mp.playerSelector(mp.PlayerNumber.One))
})
sprites.onOverlap(SpriteKind.khliglt, SpriteKind.fireing2, function (sprite, otherSprite) {
    statusbar2.value += -5
    sprites.destroy(projectile)
})
